import { RoundedRectDrawer } from "./RoundedRectDrawer.js";
export async function loadRoundedRectShape(engine, refresh = true) {
    engine.checkVersion("3.8.1");
    await engine.addShape(new RoundedRectDrawer(), refresh);
}
